import React, { useState, useEffect } from 'react';
import * as api from "../api/index.js"; // import all from api

const ParkingSpots = () => {

    const [allSlots, setAllSlots] = useState([]);

    const getAllSlots = async () => {
        try {
            console.log("getAllSlots called");

            const { data } = await api.fetchSlots();

            console.log(data);

            setAllSlots(data);
        } catch (error) {
            console.log(error.message);
        }
    };

    useEffect(() => {
        getAllSlots();
    }, []);

  return (
      <div style = {{margin:'2rem'}}>
        <h3>List of Parking Slots</h3>
        <div>
          <ol>
            <li>101 <span>Empty</span></li>
            <li>201 <span>Empty</span></li>
            <li>301 <span>Empty</span></li>
          </ol>
        </div>
      </div>
  );
};

export default ParkingSpots;
